from typing import List
from bisect import bisect_left


class Solution:
    def minimumCost(self, nums: List[int], k: int, dist: int) -> int:
        first = nums[0]
        nums = nums[1:]
        k = k - 1
        window = [(num, idx) for idx, num in enumerate(nums[:dist+1])]
        window.sort()
        #print(f"k = {k}, dist = {dist}, n = {len(nums)}")
        #print(f"initial window = {window}")
        best = curr = sum([num for num, _ in window[:k]])
        print(f"initial best = {best}")
        for i in range(dist+1, len(nums)):
            if i % 10000 == 0:
                print(f"i is {i}")
            # remove earliest element from window
            earliest = i - dist - 1
            earliest_index = bisect_left(window, (nums[earliest], earliest))
            #window = window[:earliest_index] + window[earliest_index + 1:]
            del window[earliest_index]
            #print(f"  window after remove = {window}")
            if earliest_index < k:
                curr -= nums[earliest]
                if len(window) >= k:
                    curr += window[k-1][0]
                #print(f"  decrease curr by {nums[earliest]} => {curr}")
            # insert into the current window
            newest_index = bisect_left(window, (nums[i], i))
            window.insert(newest_index, (nums[i], i))
            #print(f"  window after add = {window}")
            #print(f"  insert indx = {newest_index}, k = {k}")
            if newest_index < k:
                curr += nums[i]
                if len(window) > k:
                    curr -= window[k][0]
                #print(f"  increase curr by {nums[i]} => {curr}")
            if curr < best:
                best = curr
            #print(f"new window = {window}")
            #print(f"new curr = {curr}, new best = {best}")
        return best + first

